- input: "TEXT\x1CC00171843\x1Cfedf53fd-64f0-45b6-9\x1C\x1CF3XA\x1COn or about April
    3, 2008 the Liberty Mutual (the PAC) made a contribution to the Friends of Rahm
    Emanuel.  The PAC did not designate on the check or in any writing accompanying
    the check that the contribution was intended for the 2008 primary election.  FEC
    regulations require that since the 2008 primary election had already occurred
    and the contribution was without designation as to a particular election, that
    the contribution be applied to the 2008 general election.  Due to a clerical error
    the PAC mistakenly designated the contribution on its May Monthly FEC report to
    the 2008 primary election.  This amendment correctly designates the contribution
    to the 2008 general election."
